import './App.css';

function App() {
  return (
    <div className="App-header">
      <div className="App-aboutPage">
        <div className="App-rectangle">
          <img src="src/images/IG_headshot.jpg" alt="my headshot"/>
          <h1>hello, i'm hannah.</h1>
          <h4>i am a junior at MIT studying computer science with a concentration in linguistics. i enjoy taking on creative and challenging projects, and i am especially passionate about spreading my love for technology to others through education.</h4>
          <div clasName="App-socials"></div>
        </div>
        <div className="App-aboutMe">
        </div>
      </div>
    </div>
  );
}

export default App;
